import React, { useState } from 'react';
import BackendApi from './api/BackEndAPI';

function SearchExchangeRate() {
  const [fromCurrency, setFromCurrency] = useState("");
  const [toCurrency, setToCurrency] = useState("");
  const [message, setMessage] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await BackendApi.updateExchangeRate(fromCurrency, toCurrency);
      setMessage("Exchange rate table updated successfully.");
    } catch (error) {
      setMessage("Error updating exchange rate table.");
    }
  };

  return (
    <div>
      <h1>Search Exchange Rate</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>From Currency:</label>
          <input
            type="text"
            value={fromCurrency}
            onChange={(e) => setFromCurrency(e.target.value.toUpperCase())}
          />
        </div>
        <div>
          <label>To Currency:</label>
          <input
            type="text"
            value={toCurrency}
            onChange={(e) => setToCurrency(e.target.value.toUpperCase())}
          />
        </div>
        <button type="submit">Search</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
}

export default SearchExchangeRate;
